import Link from 'next/link';

const Navbar = () => (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <ul className="navbar-nav mr-auto">
            <li className="nav-item" >
                <Link href="/"><a className="nav-link">Popular</a></Link>
            </li>
            <li className="nav-item">
                <Link href="/movies"><a className="nav-link">Movies</a></Link>
            </li>
            <li className="nav-item">
                <Link href="/shows"><a className="nav-link">Shows</a></Link>
            </li>
        </ul>
        <img src="https://lh3.googleusercontent.com/z61emcjy_0JatoBNeD2xsZswRXXnwvUdPeR2zFka5muBH8v94ljqD18fcxeGjztOEOM" class="rounded float-right" alt="..." height="50" />
        <style jsx>{`
            nav {
                border-radius: 0 0 8px 8px;
                box-shadow: 0px 8px 2px -5px rgba(0,0,0,0.75);
            }
            .navbar {
                position: fixed;
                top: 0;
                left: 0;
                z-index: 9999;
                width: 100%;
                bottom: 30px;
            }
        `}
        </style>
    </nav>
)

export default Navbar;
